    alert("test");
  }
  const hashPw = CryptoJS.SHA256(this.formData.PW).toString();

  return (
    <div className="App">
    <Menubar></Menubar>
    <div className="App-content-SignUp">
      <form className="signup-form">
        <div className="password-field">
          <input
            type={"password"}
            name="PW"
